minimalist-mobile-tapbar.card-mod-root-yaml:
ha-tabs$: |
  #tabsContent {
    width: 97%;
  }
.: |
  @media (orientation: portrait) {
    a.menu-link[target="_blank"], ha-button-menu, ha-menu-button, [main-title] {
      display: none !important;
    }
    app-toolbar {
      padding-right: 0px;
      padding-left: 0px;
    }
  }
  ha-app-layout{
    transform: initial;
    padding: 0 !important;
    margin: 0 !important;
    width: 100%;
    height: 100% !important;
  }
  app-header {
    top: auto;
    bottom: 0;
    box-shadow: var(--footer-shadow);
    position: fixed;
    height: var(--header-height) !important;
  }
  app-toolbar {
    height: var(--header-base-height) !important;
    padding-bottom: env(safe-area-inset-bottom) !important;
  }
  #view {
    margin-top: calc(-1 * var(--header-height)) !important;
    padding-bottom: var(--header-height);
  }
  ha-tabs {
    --paper-tabs-selection-bar-color: var(--header-tab-indicator-color);
    --mdc-icon-size: 26px;
    display: flex;
    justify-content: space-between;
    padding: 0 10px;
    height:50px !important;
  }
  paper-tab[aria-selected=true] {
    color: var(--header-active-tab-color);
    background-color: var(--header-active-tab-bg-color);
  }
  paper-tab {
    color: var(--header-all-tabs-color);
    border-radius: 25px;
    height:50px;
    /*width: calc(100% / 4);
    padding: 0;*/
    padding-left: 20px;
    padding-right: 20px;
  }

